import React from 'react';
import moment from 'moment';
import alasql from 'alasql';
import jsPDF from 'jspdf';
import 'jspdf-autotable';
import _ from 'lodash';
import { Button } from 'primereact/button';
import { useIntl } from 'react-intl';
import { formatCurrency } from 'helpers/currency';

interface ExportTypes {
  reportList: any;
}

/* eslint-disable */
export default function ExportPdf({
  reportList,
}: ExportTypes) {
   
    let handleCSVData: any = [];

    const intl = useIntl();

    alasql.fn.formatMyPir = function (d) {
        return d % 2 === 0 ? `${d}.0` : d;
    };
    alasql.fn.formatMyDate = function (d) {
        return !_.isNil(d) && !_.isEmpty(d) ? `${moment(d).format('DD/MM/YYYY')}` : '';
    };
    alasql.fn.formatMyCurrency = function (d) {
        return d;
    };
    alasql.fn.formatMyInvestor = function (g, n) {
        return `${g} ${n}`;
    };
    alasql.fn.formatMyUnitBalance = function (d) {
        return d === 0 || d === null ? '0.0000' : d;
    };

    function exportMyPdf(clientcountArr: any) {
        const doc:any = new jsPDF();
        const abc:any = [];
        let myTotal = 0;
        handleCSVData.map((val: any) => {
          console.log(val);
            myTotal += val.amount;
            return abc.push(
              [
                val.ticketId,
                val.devoteeId,
                val.devoteeName,
                val.devoteePhoneNumber,
                val.devoteeEmail,
                val.transStatus,
                val.serviceName,
                val.orderNotes,
                val.createdAt,
                val.amount,
              ]);
        });
      
        //abc.push(['','','','','','','','','',formatCurrency(intl,myTotal)]);
        const header = [
          'TicketId','DID','devoteeName','PhoneNumber',
        'Email ID','transStatus','serviceName','DevoteNotes','BookedDate','amount'];
        let tableTopmargin = 38;
        doc.autoTable({
            head: [header],
            body: abc,
            margin: {
                top: tableTopmargin,
                left: 2,
                right: 3,
                bottom: 38,
            },
            didDrawPage(cell: any) {

                const currentPage = doc.internal.getCurrentPageInfo().pageNumber;
                cell.doc.setDrawColor(0);
                cell.doc.setFillColor(0, 66, 97);
                cell.doc.rect(2, 10, 140, 8, 'F');
                doc.setFont('helvetica', 'bold');
                doc.setFontSize(13);
                cell.doc.setTextColor(255);
                cell.doc.text('Sri Sathya Narayana Temple income report', 3, 16);
                doc.setFont('helvetica', 'normal');
                doc.setFontSize(11);
                cell.doc.setTextColor(255);
                doc.setFont('helvetica', 'normal');
                doc.setFontSize(11);
                cell.doc.setTextColor(0);
                // cell.doc.text(`Requested by: ${requestedBy}`, 3, 25);
                cell.doc.page = currentPage;
                doc.setFont('helvetica', 'bold');
                cell.doc.setDrawColor(255, 0, 0);
                doc.setFontSize(9);
                //doc.text(155, 25, `Total Value: ${myTotal}`);
                cell.doc.page = currentPage + 1;
                let clientCount = 0;
                if (clientcountArr.length > 0) {
                    clientCount = clientcountArr[0].totalAmount;
                }
                cell.doc.page = currentPage;
                doc.setFont('helvetica', 'normal');
                doc.setFontSize(11);
                cell.doc.setTextColor(0);
                cell.doc.page = currentPage + 1;
                doc.setFont('helvetica', 'normal');
                doc.setFontSize(11);
                cell.doc.setTextColor(0);
                const splitTitle = cell.doc.splitTextToSize(`Total value : ${formatCurrency(intl,myTotal)}`, 145);
                doc.setFontSize(11);
                doc.setFont('helvetica', 'bold');
                doc.text(splitTitle, 3, 30, 'left');
                cell.doc.setTextColor(100);
                cell.doc.text(moment().format('DD/MM/YYYY hh:mm:ss'), 3, 280);
                const imgData = 'data:image/jpeg;base64,'; // Replace with your logo image data
                doc.addImage(imgData, 'JPEG', 154, 9, 50, 20); 

                
            },
            didParseCell(data: any) {
                if (data.column.dataKey === 8 || data.column.dataKey === 9) {
                    data.cell.styles.halign = 'right';
                }
              
                if (data.row.index % 2 !== 0) {
                    data.cell.styles.fillColor = [220, 216, 215];
                }
            },
            columnStyles: {
                0: { cellWidth: 26, fontSize: 7 },
                1: { cellWidth: 13 },
                2: { cellWidth: 20 },
                3: { cellWidth: 22 },
                4: { cellWidth: 24 },
                5: { cellWidth: 18 },
                6: { cellWidth: 25 },
                7: { cellWidth: 19 },
                8: { cellWidth: 19 },
                9: { cellWidth: 19 },
            },
            bodyStyles: { height: 5 },
            headStyles: { fillColor: [0, 66, 97], valign: 'bottom' },
            styles: {
                overflow: 'linebreak', fontSize: 8, cellPadding: 1, rowHeight: 1, cellHeight: 1,
            },
        });

        for (let i = 1; i <= doc.getNumberOfPages(); i += 1) {
            doc.setPage(i);
            doc.setFont('helvetica', 'normal');
            doc.setFontSize(9);
            doc.setTextColor(100);
            doc.text(`Page ${i} of ${doc.getNumberOfPages()}`, 190, 280);
        }

        doc.save('incomeReport.pdf');
    }

    const generatePdf = () => {
        handleCSVData = alasql('SELECT ticketId,devoteeId,devoteeName,devoteePhoneNumber,amount,devoteeEmail,transStatus,serviceName,orderNotes,formatMyDate(createdAt) as createdAt,amount FROM ?', [reportList]);
        const clientArr = alasql('SELECT COUNT(amount) as totalAmount FROM ?', [reportList]);
        exportMyPdf(clientArr);
    };

    return (
      <Button type="button" icon="pi pi-file-pdf" rounded className="rounded-pdf" onClick={generatePdf}data-pr-tooltip="PDF" />
    );
}
